import Logo from "./Logo";

function HeaderAgain(props){

  return(
    <header className="bg-white">
      <div className="inner-header blue">
        <h1><Logo /></h1>
        <h2>残念！</h2>
        <p className="unCollect">

        </p>
        <p className="subTitle">再度挑戦してみよう！</p>
      </div>
    </header>
  );
}

export default HeaderAgain;
